import axios from "axios";
import * as dotenv from "dotenv";
dotenv.config();
import React, { useEffect } from "react";


function PlaneTracker() {
    useEffect(() => {
        axios.get(`https://api.aviationstack.com/v1/flights?access_key=${process.env.aviationstack_apikey}`)
        .then(response => {
            console.log(response.data);
        }).catch(err => console.log(err));
    });
    return (
        <>
         <main>
             <h1></h1>
         </main>
        </>
    );
}
export default PlaneTracker;
